              "videoId": "EUloqRDQSRM",
              "textDisplay": "@Paul Semler Following JESUS\u003cbr\u003e\u003cbr\u003eFollowing JESUS, have faithfulness and righteousness, no complaint, no falsehood, and no turning back.\u003cbr\u003e \u003cbr\u003eFollowing JESUS, have peace and rejoice, no hopeless, no helpless, no giving up.\u003cbr\u003e \u003cbr\u003eFollowing JESUS, have kindness and goodness, no wickedness no evilness, no cruel-hearted.\u003cbr\u003e \u003cbr\u003eFollowing JESUS, have lowliness and gentleness, no arrogance, no stubbornness, no puffed up.\u003cbr\u003e \u003cbr\u003eFollowing JESUS, have longsuffering and forgiving, no ungodly, no uncleanness, no outbursts of wrath.\u003cbr\u003e \u003cbr\u003eFollowing JESUS, have self-control and content, no covetousness, no jealousies, no selfish ambitions.\u003cbr\u003e \u003cbr\u003eFollowing JESUS, have holiness and allegiance, no idolatry, no adultery, no double-minded.\u003cbr\u003e\u003cbr\u003eHaving the love and truth from HEAVENLY FATHER, bearing the gifts and witnesses of HOLY SPIRIT, taking up our cross and following SAVIOR JESUS CHRIST, from this time forth until forevermore.\u003cbr\u003e \u003cbr\u003eFollowing LORD JESUS CHRIST, from this time forth until forevermore, are freed from sins and are new creations, should be Christians and be Overcomers.\u003cbr\u003e\u003cbr\u003eFollowing LORD JESUS CHRIST,  from this time forth until forevermore, have Shalom and Shabbat since Immanuel, can walk with the Glorious GOD.\u003cbr\u003e\u003cbr\u003eFollowing LORD JESUS CHRIST, from this time forth until forevermore, inherit abundant eternal lives. There shall be no more death, nor sorrow, nor crying, and nor pain in the New Eternal Holy Jerusalem.\u003cbr\u003e\u003cbr\u003eBest regards,\u003cbr\u003e John (Zhen Li)",
              "textOriginal": "@Paul Semler Following JESUS\n\nFollowing JESUS, have faithfulness and righteousness, no complaint, no falsehood, and no turning back.\n \nFollowing JESUS, have peace and rejoice, no hopeless, no helpless, no giving up.\n \nFollowing JESUS, have kindness and goodness, no wickedness no evilness, no cruel-hearted.\n \nFollowing JESUS, have lowliness and gentleness, no arrogance, no stubbornness, no puffed up.\n \nFollowing JESUS, have longsuffering and forgiving, no ungodly, no uncleanness, no outbursts of wrath.\n \nFollowing JESUS, have self-control and content, no covetousness, no jealousies, no selfish ambitions.\n \nFollowing JESUS, have holiness and allegiance, no idolatry, no adultery, no double-minded.\n\nHaving the love and truth from HEAVENLY FATHER, bearing the gifts and witnesses of HOLY SPIRIT, taking up our cross and following SAVIOR JESUS CHRIST, from this time forth until forevermore.\n \nFollowing LORD JESUS CHRIST, from this time forth until forevermore, are freed from sins and are new creations, should be Christians and be Overcomers.\n\nFollowing LORD JESUS CHRIST,  from this time forth until forevermore, have Shalom and Shabbat since Immanuel, can walk with the Glorious GOD.\n\nFollowing LORD JESUS CHRIST, from this time forth until forevermore, inherit abundant eternal lives. There shall be no more death, nor sorrow, nor crying, and nor pain in the New Eternal Holy Jerusalem.\n\nBest regards,\n John (Zhen Li)",
